INSERT INTO `movies` VALUES (284052,'Doctor Strange','doctor-strange','2016-10-25',7.40,'After his career is destroyed, a brilliant but arrogant surgeon gets a new lease on life when a sorcerer takes him under her wing and trains him to defend the world against evil.','2022-05-09 02:09:54','2022-05-09 02:09:54'),(294793,'All the Old Knives','all-the-old-knives','2022-04-08',6.00,'When the CIA discovers one of its agents leaked information that cost more than 100 people their lives, veteran operative Henry Pelham is assigned to root out the mole with his former lover and colleague Celia Harrison.','2022-05-09 02:12:45','2022-05-09 02:12:45'),(335787,'Uncharted','uncharted','2022-02-10',7.20,'A young street-smart, Nathan Drake and his wisecracking partner Victor “Sully” Sullivan embark on a dangerous pursuit of “the greatest treasure never found” while also tracking clues that may lead to Nathan’s long-lost brother.','2022-05-09 02:04:43','2022-05-09 02:04:43'),(406759,'Moonfall','moonfall','2022-02-03',6.50,'A mysterious force knocks the moon from its orbit around Earth and sends it hurtling on a collision course with life as we know it.','2022-05-09 02:10:57','2022-05-09 02:10:57'),(414906,'The Batman','the-batman','2022-03-01',7.80,'In his second year of fighting crime, Batman uncovers corruption in Gotham City that connects to his own family while facing a serial killer known as the Riddler.','2022-05-09 02:04:07','2022-05-09 02:04:07'),(453395,'Doctor Strange in the Multiverse of Madness','doctor-strange-in-the-multiverse-of-madness','2022-05-04',7.60,'Doctor Strange, with the help of mystical allies both old and new, traverses the mind-bending and dangerous alternate realities of the Multiverse to confront a mysterious new adversary.','2022-05-09 02:07:05','2022-05-09 02:07:05'),(508947,'Turning Red','turning-red','2022-03-10',7.40,'Thirteen-year-old Mei is experiencing the awkwardness of being a teenager with a twist – when she gets too excited, she transforms into a giant red panda.','2022-05-09 02:08:42','2022-05-09 02:08:42'),(568124,'Encanto','encanto','2021-11-24',7.70,'The tale of an extraordinary family, the Madrigals, who live hidden in the mountains of Colombia, in a magical house, in a vibrant town, in a wondrous, charmed place called an Encanto. The magic of the Encanto has blessed every child in the family with a unique gift from super strength to the power to heal—every child except one, Mirabel. But when she discovers that the magic surrounding the Encanto is in danger, Mirabel decides that she, the only ordinary Madrigal, might just be her exceptional family\'s last hope.','2022-05-09 02:11:39','2022-05-09 02:11:39'),(585083,'Hotel Transylvania: Transformania','hotel-transylvania-transformania','2022-02-25',7.10,'When Van Helsing\'s mysterious invention, the \"Monsterfication Ray,\" goes haywire, Drac and his monster pals are all transformed into humans, and Johnny becomes a monster. In their new mismatched bodies, Drac and Johnny must team up and race across the globe to find a cure before it\'s too late, and before they drive each other crazy.','2022-05-09 02:13:18','2022-05-09 02:13:18'),(606402,'Yaksha: Ruthless Operations','yaksha-ruthless-operations','2022-04-08',6.20,'Nicknamed after a human-devouring spirit, the ruthless leader of an overseas black ops team takes up a dangerous mission in a city riddled with spies.','2022-05-09 02:12:14','2022-05-09 02:12:14'),(629542,'The Bad Guys','the-bad-guys','2022-03-17',7.80,'When the infamous Bad Guys are finally caught after years of countless heists and being the world’s most-wanted villains, Mr. Wolf brokers a deal to save them all from prison.','2022-05-09 02:09:11','2022-05-09 02:09:11'),(634649,'Spider-Man: No Way Home','spider-man-no-way-home','2021-12-15',8.10,'Peter Parker is unmasked and no longer able to separate his normal life from the high-stakes of being a super-hero. When he asks for help from Doctor Strange the stakes become even more dangerous, forcing him to discover what it truly means to be Spider-Man.','2022-05-09 02:07:42','2022-05-09 02:07:42'),(675353,'Sonic the Hedgehog 2','sonic-the-hedgehog-2','2022-03-30',7.70,'After settling in Green Hills, Sonic is eager to prove he has what it takes to be a true hero. His test comes when Dr. Robotnik returns, this time with a new partner, Knuckles, in search for an emerald that has the power to destroy civilizations. Sonic teams up with his own sidekick, Tails, and together they embark on a globe-trotting journey to find the emerald before it falls into the wrong hands.','2022-05-09 02:02:44','2022-05-09 02:02:44'),(696806,'The Adam Project','the-adam-project','2022-03-11',7.00,'After accidentally crash-landing in 2022, time-traveling fighter pilot Adam Reed teams up with his 12-year-old self on a mission to save the future.','2022-05-09 02:15:40','2022-05-09 02:15:40'),(763285,'Ambulance','ambulance','2022-03-16',7.00,'Decorated veteran Will Sharp, desperate for money to cover his wife\'s medical bills, asks for help from his adoptive brother Danny. A charismatic career criminal, Danny instead offers him a score: the biggest bank heist in Los Angeles history: $32 million.','2022-05-09 02:08:10','2022-05-09 02:08:10'),(799876,'The Outfit','the-outfit','2022-02-25',7.00,'Leonard is an English tailor who used to craft suits on London’s world-famous Savile Row. After a personal tragedy, he’s ended up in Chicago, operating a small tailor shop in a rough part of town where he makes beautiful clothes for the only people around who can afford them: a family of vicious gangsters.','2022-05-09 02:10:22','2022-05-09 02:10:22'),(823625,'Blacklight','blacklight','2022-02-10',6.20,'Travis Block is a shadowy Government agent who specializes in removing operatives whose covers have been exposed. He then has to uncover a deadly conspiracy within his own ranks that reaches the highest echelons of power.','2022-05-09 02:14:45','2022-05-09 02:14:45'),(893370,'Virus:32','virus32','2022-04-21',6.70,'A virus is unleashed and a chilling massacre runs through the streets of Montevideo.','2022-05-09 01:45:24','2022-05-09 01:45:24'),(919689,'War of the Worlds: Annihilation','war-of-the-worlds-annihilation','2021-12-22',5.60,'A mother and son find themselves faced with a brutal alien invasion where survival will depend on discovering the unthinkable truth about the enemy.','2022-05-09 02:16:56','2022-05-09 02:16:56'),(951470,'Silverton Siege','silverton-siege','2022-04-27',6.70,'After a failed sabotage mission, a trio of anti-apartheid freedom fighters ends up in a tense bank hostage situation. Based on a true story.','2022-05-09 02:16:21','2022-05-09 02:16:21');
